    //this.setState({ title: this.state.title, isCompleted: true });
  }

  render() { 
    return (
      <div className="App"> 
        {
          this.todoItems.map((item, index) => {
            <TodoItem key={index} item={item} onClick={this.onItemClicked}/>
          })
        }
      </div>
    );
  }

}

export default App;
